webpackJsonp([0x690db26b6f70],{9052:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Second Steps",date:"02 Apr 2002",slug:"/2002-04-02-second-steps/",tags:"Y2002"},html:"<p>Hmm, I thought I said this out loud, but I guess I only <a href=\"/2002/03/13\">alluded</a> to it in a title...  I'm on a diet. I'm trying to lose weight. I'm <a href=\"http://www.weightwatchers.com\">eating points</a> instead of food. And my score is 3.3 kg in 3 weeks. But I've still got many weeks to go.</p>"},next:{fields:{title:"Rolling Referers",date:"02 Apr 2002",slug:"/2002-04-02-rolling-referers/"}},previous:{fields:{title:"Housewarming",date:"03 Apr 2002",slug:"/2002-04-03-housewarming/"}}},{node:{fields:{title:"Rolling Referers",date:"02 Apr 2002",slug:"/2002-04-02-rolling-referers/",tags:"Y2002"},html:'<p>Thanks to <a href="http://ranchero.com/php/rollingreferers/">Brent at Ranchero.com</a>, I now have a <a href="/referers.php">rolling referers page</a>, but it will be pretty boring until people and robots start discovering my new URL.</p>'},next:{fields:{title:"Back To The Grind",date:"02 Apr 2002",slug:"/2002-04-02-back-to-the-grind/"}},previous:{fields:{title:"Second Steps",date:"02 Apr 2002",slug:"/2002-04-02-second-steps/"}}},{node:{fields:{title:"Back To The Grind",date:"02 Apr 2002",slug:"/2002-04-02-back-to-the-grind/",tags:"Y2002"},html:"<p>Party's over, it's back to work today after the four-day weekend. One thing I'll be checking out at the office is the new Codeweavers <a href=\"http://www.codeweavers.com/products/office/\">CrossOver Office</a>. Our developers all run Linux, but need Windows for Notes and to view the occasional Word document (they don't need full MS Office licenses). We've been running <a href=\"http://www.citrix.com\">Citrix</a> servers up to now, but that's expensive and they tend to max out at 25 users. If CrossOver works out, we might get a few dozen licenses to run Notes clients. And if <a href=\"http://radio.userland.com\">Radio</a> will work with it, I'll get one for home.</p>\n<p>Speaking of Citrix, I finally got the Citrix client to work on FreeBSD. I should have known, it's a <a href=\"http://www.freshports.org/port-description.php3?port=201\">port</a>!</p>"},next:{fields:{title:"Bunny Bread",date:"01 Apr 2002",slug:"/2002-04-01-bunny-bread/"}},previous:{fields:{title:"Rolling Referers",date:"02 Apr 2002",slug:"/2002-04-02-rolling-referers/"}}}],pathPrefix:"",first:!1,last:!1,index:910,pageCount:1101}}}});
